BEGIN TRANSACTION;
PRAGMA defer_foreign_keys = 1;
DROP TABLE IF EXISTS "cards";
CREATE TABLE "cards" (
	"matchId"	INTEGER NOT NULL,
	"playerId"	INTEGER NOT NULL,
	"cardType"	TEXT NOT NULL,
	"minute"	INTEGER,
	PRIMARY KEY("matchId","playerId","cardType","minute"),
	FOREIGN KEY("matchId")
		REFERENCES "matches"("matchId")
		ON UPDATE CASCADE
		ON DELETE CASCADE,
	FOREIGN KEY("playerId")
		REFERENCES "players"("playerId")
		ON UPDATE CASCADE
		ON DELETE CASCADE
);
DROP TABLE IF EXISTS "clubs";
CREATE TABLE "clubs" (
	"clubId"	INTEGER NOT NULL,
	"clubName"	TEXT,
	"wikiKey"	TEXT,
	"wikiLang"	TEXT,
	PRIMARY KEY("clubId")
);
DROP TABLE IF EXISTS "competitions";
CREATE TABLE "competitions" (
	"competitionId"	INTEGER NOT NULL,
	"competitionName"	TEXT,
	PRIMARY KEY("competitionId")
);
DROP TABLE IF EXISTS "goals";
CREATE TABLE "goals" (
	"matchId"	INTEGER NOT NULL,
	"playerId"	INTEGER NOT NULL,
	"scoreHomeTeam"	INTEGER NOT NULL,
	"scoreAwayTeam"	INTEGER NOT NULL,
	"minute"	INTEGER,
	"extratime"	INTEGER,
	PRIMARY KEY("matchId","playerId","scoreHomeTeam","scoreAwayTeam"),
	FOREIGN KEY("matchId")
		REFERENCES "matches"("matchId")
		ON UPDATE CASCADE
		ON DELETE CASCADE,
	FOREIGN KEY("playerId")
		REFERENCES "players"("playerId")
		ON UPDATE CASCADE
		ON DELETE CASCADE
);
DROP TABLE IF EXISTS "lineups";
CREATE TABLE "lineups" (
	"matchId"	INTEGER NOT NULL,
	"playerId"	INTEGER NOT NULL,
	"clubId"	INTEGER NOT NULL,
	"starting"	INTEGER,
	PRIMARY KEY("matchId","playerId"),
	FOREIGN KEY("matchId")
		REFERENCES "matches"("matchId")
		ON UPDATE CASCADE
		ON DELETE CASCADE,
	FOREIGN KEY("playerId")
		REFERENCES "players"("playerId")
		ON UPDATE CASCADE
		ON DELETE CASCADE
);
DROP TABLE IF EXISTS "matches";
CREATE TABLE "matches" (
	"matchId"	INTEGER NOT NULL,
	"dateAndTime"	TEXT NOT NULL UNIQUE,
	"seasonId"	INTEGER,
	"homeClubId"	INTEGER NOT NULL,
	"homeClubName"	TEXT NOT NULL,
	"homeClubFinalScore"	INTEGER,
	"homeClubPenalties"	INTEGER DEFAULT NULL,
	"awayClubId"	INTEGER NOT NULL,
	"awayClubName"	TEXT NOT NULL,
	"awayClubFinalScore"	INTEGER,
	"awayClubPenalties"	INTEGER DEFAULT NULL,
	"canceled"	INTEGER DEFAULT 0,
	PRIMARY KEY("matchId"),
	FOREIGN KEY("awayClubId") REFERENCES "clubs"("clubId") ON UPDATE CASCADE ON DELETE CASCADE,
	FOREIGN KEY("homeClubId") REFERENCES "clubs"("clubId") ON UPDATE CASCADE ON DELETE CASCADE,
	FOREIGN KEY("seasonId") REFERENCES "seasons"("seasonId") ON UPDATE CASCADE ON DELETE CASCADE
);
DROP TABLE IF EXISTS "players";
CREATE TABLE "players" (
	"playerId"	INTEGER NOT NULL,
	"playerName"	TEXT NOT NULL,
	"wikiKey"	TEXT,
	"wikiLang"	TEXT,
	PRIMARY KEY("playerId")
);
DROP TABLE IF EXISTS "seasons";
CREATE TABLE "seasons" (
	"seasonId"	INTEGER NOT NULL,
	"seasonStartYear"	INTEGER NOT NULL,
	"competitionId"	INTEGER NOT NULL,
	PRIMARY KEY("seasonId"),
	FOREIGN KEY("competitionId")
		REFERENCES "competitions"("competitionId")
		ON UPDATE CASCADE
		ON DELETE CASCADE
);
DROP TABLE IF EXISTS "substitutions";
CREATE TABLE "substitutions" (
	"matchId"	INTEGER NOT NULL,
	"playerIdOut"	INTEGER NOT NULL,
	"playerIdIn"	INTEGER,
	"minute"	INTEGER,
	PRIMARY KEY("matchId","playerIdOut"),
	FOREIGN KEY("matchId")
		REFERENCES "matches"("matchId")
		ON UPDATE CASCADE
		ON DELETE CASCADE,
	FOREIGN KEY("playerIdOut")
		REFERENCES "players"("playerId")
		ON UPDATE CASCADE
		ON DELETE CASCADE,
	FOREIGN KEY("playerIdIn")
		REFERENCES "players"("playerId")
		ON UPDATE CASCADE
		ON DELETE CASCADE
);
COMMIT;